import React, {Component} from 'react';


class CommentRow extends Component {
    render() {
        const c = this.props.data;
        return <div>
            <p> Comment ID: {c.commentId} | Author: {c.userId} | Post: {c.postId} | Message: {c.message} </p>
        </div>
    }
}
export default CommentRow;
